import './cont.css';
import Homepage from './components/PageOne';
import Header from './components/Header';

class Home extends Component{
    render(){
        return(
           <div className="cont"> 
             <Homepage/>
            </div>
        )
    }
}

class About extends Component{

    render(){        
    let
    i:string='message',
    a:string='About',
    b:string='Albums';

    return(

<div className = "cont">

    <Header i={i} a = {a}  b={b}/>

</div>

        )
    }
}


export {Home,About}
